import React from 'react';

function LoginConfirmation(props) {
    return (

        <div>
            {props.userAccount.map(userAccount => {
                let usernameMap = userAccount.username;
                let passwordMap = userAccount.password;

                return(
                    <div>
                        <span className="login-fill">Username</span><br />
                                <input type="text" name="username" value={props.cred.username}
                                    onChange={props.inputChanged} /><br />
                                <span className="login-fill">Password</span><br />
                                <input type="password" name="password" value={props.cred.password}
                                    onChange={props.inputChanged} />
                        <div name="usernameMap" value={props.cred.usernameMap} onLoad={props.inputChanged}></div>
                    </div>
                );
            })}
        </div>
    );
}

export default LoginConfirmation;
